caption:
Fly free little songs. Full Moon Fight (EP) available everywhere now. Thanks everyone for your support. Stories take on so many forms and these few have always wanted to show up in this way. So many people to thank for helping this come to life.

Foremost - My producer and longtime friend @eliandwest for helping me bring this to life with his trio of instantly talented musicians and giving me the confidence to record this album in a live setting. 

@mgonigle for his amazing fiddle playing throughout. What an honor - melody chasing magic!

@forrestliketrees for his tasteful bass work, keeping even the weirdest musical passages of ‚ÄúCalling Cousteau‚Äù on time. Vibe tech!

@swingfingers.recording for his education, patience and mentoring through this process and building us a studio in an old lodge on Mount Rainer from the ground up. 

@cahalen_morrison for helping me turn these ideas into thoughtful words and pushing me to chase more poetic ideas. Every song has his touch. 

@nickwdunbar for reigniting this musical journey for me over the years and lovingly molding this piece of hard clay into something somewhat supple enough to even be able to play with this band. 

@gregoryalanisakov for the years of inspo and friendship, lyrical guidance and helping me throughly through the mixing process.

@sealegacy @paulnicklen @mitty for always being my biggest support system and championing me to explore this project, through and through. . 

@jer.collins for the cover illustration and visualizing these songs into a genuine handmade piece of art. 

@orienstar - My true love. No words. 

So many others‚Ä¶ @earth2aaron @flyingpark @noahsolt @courtneyannehartman @bonnieandtaylorsims @rachelsliker on & on‚Ä¶

When all the photographs have been taken. What‚Äôs left?

‚ÄúWelcome to the Family‚Äù shot on the new @sonyalpha 7CR @ 7CII explores what drives our community and creators around the world to find their passion and tell their stories. ‚ÄúIf you haven‚Äôt found a reason to die, you haven‚Äôt found a reason to live.‚Äù 

We all have different backgrounds and beliefs, views and perspectives, but we are bonded by an innate desire to tell stories that enhance the way people see the world we live in. I couldn‚Äôt be more proud to be part of this launch and to get to share my world with my father.

